import '../assets/css/App.css';

import TopBar from '../components/topbar/TopBar';
import ListStudents from '../components/list-students/ListStudents';
import Footer from '../components/footer/Footer';
import NewStudent from './new-student/NewStudent';
import EditStudent from './edit-student/EditStudent';


import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';


function App() {

  return (
    <Router>

        <div className="App">
            <header className="App-header" >
              <TopBar ></TopBar>
            </header>
              <div className="App-content">
                <ListStudents></ListStudents>
              </div>
              <div className="App-content">
                <NewStudent></NewStudent>
              </div>
              <div className="App-content">
                <EditStudent></EditStudent>
              </div>
            <div className="App-footer">
              <Footer></Footer>
            </div>
             <Switch>
             <Route exact path="/"></Route>
             <Route exact path="/new-student"></Route>
             <Route exact path="/edit-student/:id"></Route>
            </Switch>
        </div>
    </Router>
  );
}

export default App;
